#include <vector>
#include <algorithm>
#include <unordered_map>
using namespace std;

class Solution {
public:
    int countSubMultisets(vector<int>& nums, int l, int r) {
        const int MOD = 1e9 + 7;
        vector<long long> dp(20001, 0);
        dp[0] = 1; // Empty set

        for (int num : nums) {
            for (int i = 20000; i >= num; --i) {
                dp[i] = (dp[i] + dp[i - num]) % MOD;
            }
        }

        // Prefix sums for O(1) range queries
        for (int i = 1; i <= 20000; ++i) {
            dp[i] = (dp[i] + dp[i - 1]) % MOD;
        }

        // Adjusting for the range [l, r]
        long long total = dp[r] - (l > 0 ? dp[l - 1] : 0);
        if (total < 0) total += MOD;
        return total % MOD;
    }
};
